import React from "react";
import ReactDOM from "react-dom";
import './index.css';
import img1 from  "https://picsum.photos/200";
// const show = ["Game Of Thrones" , "Sherlock Homes" , "Breaking Bad","Jessica Jones" , 'lucifer']
const currentDate = new Date().toLocaleDateString();
const currentTime = new Date().toLocaleTimeString();

const name = "simra";

ReactDOM.render(
  <div className="som">
    <h1 contentEditable="true" >{name}</h1>
    <p>today date is {currentDate} </p>
    <p>today time is {currentTime} </p>
    <img src={img1} width="200"/>
  </div>
  , document.getElementById("root")
);

